jQuery(document).ready(function($) {
    typeof $.typeahead === 'function' && $.typeahead({
        input: ".js-typeahead-input",
        minLength: 1,
        order: "asc",
        maxItem: 5,
        dynamic: true,

        template: function (query, item) {
            var typeDisplay = '';
            switch(item.type) {
                case 'medicines':
                    typeDisplay = '(T thuc)';
                    break;
                case 'guides':
                    typeDisplay = '(Cm nang)';
                    break;
                case 'faqs':
                    typeDisplay = '(Hi p)';
                    break;
                default:
                    typeDisplay = '';
            }
            return '<span><span class="search-thumb-span">' +
                '<img src="{{thumb}}" class="search-result-thumb">' +
                "</span>" +
                '<span class="search-result-title">{{name}} <small>'+typeDisplay+'</small></span></span>'
        },

        emptyTemplate: "",
        hint: true,
        accent: true,
        searchOnFocus: true,
        source: {
            object: {
                display: ["name","name_ascii"],
                href: "{{url}}",
                ajax: function (query) {
                    return {
                        type: "GET",
                        url: URLSEARCH,
                        path: "data.object",
                        data: {
                            q: "{{query}}"
                        },
                        callback: {
                            done: function (data) {
                                console.log(data);
                                return data;
                            }
                        }
                    }
                }

            }
        },

        callback: {
            onClickAfter: function (node, a, item, event) {
                event.preventDefault();

                //window.location(item.href);
                window.location.replace(item.href);

            },

        },
        debug: false
    });

});



